    <div
      style={{
        width: "100vw",
        height: "100vh",
        justifyContent: "center",
        alignContent: "center",
        alignItems: "center",
      }}
    >
      <div
        style={{
          width: "400px",
          height: "300px",
        }}
      >
        123123
      </div>
    </div>
  );
}
